INSERT INTO `recipe` (`recipe_id`, `name`, `servings`, `prepTime`, `instructions`, `image`, `isPending`, `FromUser`, `inputIngredients`) VALUES
(1, 'Lumpia', '1-4', '', 'Heat 1 tablespoon vegetable oil in a wok or large skillet over high heat.\nAdd pork; cook and stir until crumbly and no pink is showing, 5 to 7 minutes.\nRemove pork from the pan and set aside. Drain grease from the pan, leaving just a thin coating.\nAdd onion and garlic to the pan; cook and stir until fragrant, about 2 minutes.\nStir in the cooked pork, carrots, green onions, cabbage, and cilantro.\nSeason with pepper, salt, garlic powder, and soy sauce.\nRemove from the heat, and set aside until cool enough to handle, about 5 minutes.\nAssemble lumpia: Place 3 heaping tablespoons of filling diagonally near one corner of a lumpia wrapper, leaving a 1 1/2 inch space at both ends. Fold the side along the length of the filling over the filling, tuck in both ends, and roll neatly and tightly to close. Moisten the other side of the wrapper with water to seal the edge. Transfer to a plate and cover with plastic wrap to retain moisture. Repeat to assemble remaining lumpia.\nHeat 1/2 inch vegetable oil in a heavy skillet over medium heat for 5 minutes.\nSlide 3 to 4 lumpia into the hot oil, making sure the seams are facing down.\nFry, turning occasionally, until all sides are golden brown, 1 to 2 minutes.\nTransfer to a paper towel-lined plate to drain. Repeat to fry remaining lumpia. Serve immediately.', '', 0, 1, ''),
(2, 'Chicken Adobo', '', '', 'Heat vegetable oil in a large skillet over medium-high heat.\r\nCook chicken pieces until golden brown, 2 to 3 minutes per side.\r\nTransfer chicken to a plate and set aside.\r\nAdd onion and garlic to the skillet; cook until softened and brown, about 6 minutes.\r\nPour in soy sauce and vinegar and season with garlic powder, black pepper, and bay leaf.\r\nReturn chicken to pan, increase heat to high, and bring to a boil.\r\nReduce heat to medium-low, cover, and simmer until chicken is tender and cooked through, 35 to 40 minutes.', '', 0, 0, ''),
(3, 'Pinakbet', '', '', 'Heat oil in a large pot over medium heat; stir in onion and garlic and cook until tender, about 5 minutes. <br>\nAdd pork; cook and stir until browned, 5 to 7 minutes.\nAdd prawns; cook and stir until they turn pink, about 5 minutes.\nStir in tomato; season with salt and pepper, cover and simmer for 5 minutes.\nStir in zucchini, okra, green beans, eggplant, and bitter melon; cover and cook until the vegetables are tender, about 10 minutes.', '', 0, 0, ''),
(4, 'Adobong Pusit', '', '', 'Combine squid, vinegar, and water in a small pot over medium heat; season with salt and pepper. Simmer for 10 minutes.\nMeanwhile, heat olive oil in a saucepan over medium heat; cook and stir onion and garlic in hot oil until softened, 5 to 7 minutes. Stir in tomato and soy sauce.\nPour squid mixture into tomato mixture and bring to a simmer; cook for 20 minutes.', '', 0, 1, ''),
(5, 'Atsara', '', '', 'Toss grated papaya with 1/4 cup salt together in a large bowl; allow to sit for 1 hour. Drain liquid from papaya and rinse thoroughly. Place papaya in the middle of a large piece of cheesecloth and squeeze to drain as much liquid from the papaya as possible.\nCombine papaya, carrot, bell pepper, chili peppers, ginger, and raisins together in a clean large bowl; mix. Transfer the mixture to clean, dry jars with lids.\nStir vinegar, water, sugar, and 1 teaspoon salt together in a small saucepan; bring to a boil for 5 minutes. Pour the vinegar mixture into the jars, making sure the vegetables are completely submerged in liquid.\nAllow vegetables to marinate in the liquid at least 1 day before using. Store in the refrigerator between uses.', '', 0, 0, ''),
(6, 'Ginataang Manok', '', '', 'Heat oil in a large skillet over medium heat and stir in ginger. Cook and stir until fragrant and lightly browned. Remove ginger and set aside.\nSeason chicken with salt and pepper. Place chicken in the same skillet over medium-high heat without crowding. Cook until chicken is lightly brown on all sides.\nReturn ginger to the skillet and add coconut milk. Bring to a boil, then cover with the lid tilted to allow steam to escape. Reduce heat to medium-low and simmer, stirring occasionally, until chicken is no longer pink at the bone, about 30 minutes.\nStir in spinach and simmer uncovered until spinach is warmed through, 8 to 12 minutes. Season with salt and pepper.', '', 0, 0, ''),
(7, 'Lechon Kawali', '', '', 'Combine pork belly, garlic, bay leaves, salt, and pepper in a skillet; pour in enough water to cover. Bring to a boil, reduce heat, and simmer until skin is tender, 35 to 45 minutes.<br>\nDrain and let sit at room temperature until pork has air-dried.\nHeat oil in a deep-fryer or large saucepan to 350 degrees F (175 degrees C).\nFry pork in the hot oil, working in batches, until golden brown, 3 to 5 minutes.\nRemove fried pork with a slotted spoon and drain on a paper towel-lined plate.', '', 0, 1, ''),
(8, 'Garlic Rice', '', '', 'Heat the oil in a large skillet over medium-high heat. When the oil is hot, add the garlic and ground pork. Cook and stir until the garlic is golden brown. This is the color you want for maximum flavor, do not allow it to burn, or the flavor will be bitter.\r\nStir in the cooked white rice, and season with salt and pepper. Cook and stir until heated through and well blended, about 3 minutes. Serve and enjoy.', '', 0, 0, ''),
(9, 'Pochero', '', '', 'Heat the olive oil in a large pot over medium heat; fry the plantains and potatoes in the hot oil until crisp on the outside, 5 to 7 minutes.\r\nRemove from the pot and set aside, keeping the oil in the pot.\r\nCook and stir the onion and garlic in the hot oil until the onion is translucent, 5 to 7 minutes.\r\nAdd the chicken and chorizo; season with salt and pepper. Cover the pot and cook for 5 minutes.\r\nPour enough water over the chicken to cover completely; bring to a simmer and cook for 10 minutes.\r\nAdd the tomatoes, cover, and cook another 10 minutes. Stir the plantains, potatoes, garbanzo beans, and cabbage into the mixture.\r\nCook covered until the cabbage is wilted and everything is hot, about 5 minutes more. Serve hot.', '', 0, 1, ''),
(10, 'Ginisang Munggo', '', '', 'Bring the mung beans and the water to a boil in a pot; cook at a boil until the beans are soft, about 40 minutes. Mash the beans; set aside.\r\nHeat the olive oil in a large pot; cook and stir the onion and garlic in the hot oil over medium heat until softened, 5 to 7 minutes.\r\nAdd the pork; season with salt and pepper. Continue cooking the mixture another 3 minutes.\r\nGently stir the prawns into the mixture; cook 2 minutes more. Add the tomatoes; cook another 3 minutes.\r\nReduce heat and pour the chicken broth over the mixture; allow the mixture to simmer in the broth for 5 minutes.\r\nAdd the mashed beans to the soup; mix well. Cook another 5 minutes, stirring frequently to prevent any of the mixture from sticking to the bottom of the pot.\r\nAdd more chicken broth or water if the soup is too thick. Stir the spinach leaves into the soup and cook 2 minutes more before serving hot.', '', 0, 0, ''),
(11, 'Caldereta', '', '', 'Heat vegetable oil in a large pot over medium heat. Sprinkle beef with salt and black pepper and brown in the hot oil with garlic, about 10 minutes.\r\nPour in water, pineapple juice, onion, tomato sauce, and tomato paste. Bring to a boil, turn heat to low, and simmer until beef is almost tender, 35 to 45 minutes.\r\nStir potatoes, red bell pepper, carrot, mini sausages, pineapple chunks with their juice, olives, and bay leaves into the stew.\r\nBring back to a boil and simmer until potatoes are tender, about 20 more minutes. Season with hot pepper sauce, salt, and black pepper.', '', 0, 0, ''),
(12, 'Filipino Chicken Salad', '', '', 'Bring a pot of water to a simmer over low heat. Add the chicken breast to the water and cook until no longer pink in the center and the juices run clear, about 30 minutes.\r\nAn instant-read thermometer inserted into the center should read at least 165 degrees F (74 degrees C).\r\nRemove the chicken from the water and allow to cool before shredding the meat into a large bowl.\r\nWhile the chicken cooks, bring a pot of lightly salted water to a boil.\r\nCook the macaroni at a boil until cooked through, but is still firm to the bite, about 8 minutes.\r\nDrain and rinse with cool water to halt the cooking process until the pasta is cool to the touch. Add to the bowl with the chicken.\r\nStir the pineapple, apple, celery, carrot, and raisins to the bowl; toss to combine. Add the mayonnaise, sugar, and seasoned salt; gently stir the mixture until evenly coated.\r\nRefrigerate at least 30 minutes before serving.', '', 0, 0, ''),
(13, 'Paksiw na Pata', '', '', 'Combine the pig\'s feet, vinegar, water, soy sauce, onion, garlic, peppercorns, bay leaves, sugar, and salt together in a stockpot; bring to a boil for 2 to 3 minutes.\r\nReduce heat to medium-low; allow the stew to simmer, stirring occasionally, until the meat pulls easily from the bones and the liquid has thickened, about 1 hour.\r\nServe hot.', '', 0, 1, ''),
(14, 'Bulalo', '', '', 'When buying in a supermarket ask the meat vendor cut the shank crosswise into 1 1/2\" thick pieces.\r\nThe best way to do this is to have it cut with an electric meat saw.\r\nPlace the beef shanks in a large casserole. Cover with water.\r\nAdd the onion, garlic, bay leaf, star anise, ginger, lemongrass and peppercorns.\r\nSeason with salt. Set over high heat and bring to a boil, removing scum as it rises.\r\nLower the heat, cover and simmer for two hours or until the beef is fork-tender.\r\nAlternatively, pressure-cook for one hour and 30 minutes.\r\nUsing a slotted spoon, carefully remove the beef shanks and arrange at the center of individual soup bowls.\r\nStrain the broth. Reheat to boiling point. Cut corn into 3 pcs each.\r\nCore the cabbage and cut in half. Trim the ends of the pechay.\r\nAdd the corn to the broth and simmer for 5-7 minutes.\r\nAdd the cabbage and pechay leaves and simmer for another 3 minutes.\r\nScoop the vegetables out and arrange around the bulalo.\r\nPour in hot broth and serve at once.\r\n', '', 0, 1, ''),
(15, 'Beef Mechado', '', '', 'When buying the beef, choose the meat with a little tendon. Cut the beef into bite size pieces.\r\nOn a heavy skillet heat oil and stir fry the beef for a few minutes until it turns light brown. Set aside.\r\nOn the skillet where you fry the beef, remove excess oil and retain at least 1 tablespoon.\r\nSaute garlic and onion until cooked and add the water, lemon juice or calamansi juice, soy sauce, pepper, tomato sauce, laurel leaves, salt and the beef.\r\nSimmer in low fire until the meat is tender. Then add the potatoes and carrots.\r\nSimmer for a few minutes until the potatoes and carrots are cooked.\r\nTip: it is better to simmer the beef in low fire so the meat will release its flavor.\r\n', '', 0, 0, ''),
(16, 'Pork Liver Afritada', '', '', 'Heat oil in a pan and saute onion and garlic until onions are soft. Next, add the pork liver and saute for a minute.\r\nThen add the patis and stir cook until the patis has slightly evaporated then add the carrots, potatoes, tomato sauce. Simmer for 5 minutes while stirring once in a while.\r\nThen add the green peas or chick peas, bell peppers, water, salt and pepper. Simmer for another 3 minutes or until cooked.\r\nLast but not the least, add the cornstarch slurry (dissolved cornstarch in water) and simmer for about a minute or more until the sauce is thickened.\r\n', '', 0, 0, ''),
(17, 'Pork Bistek', '', '', 'Pound the pork chops with meat mallet or back of the knife. Cut slits on the skin about 1 inch apart.\r\nIn mixing bowl, combine soy sauce, calamansi juice, liquid seasoning, garlic, sugar, black pepper and Magic sarap. Stir until the sugar is dissolved.\r\nAdd the pork chops and mix with the marinade until all the meat is well coated. Marinate the pork chops for 2 hours.\r\nHeat cooking oil in a frying pan and fry the pork chops until brown. Set aside.\r\nIn the same pan, stir fry the onions until wilted and set aside.\r\nIn the same pan, pour the marinade from the pork chops and add 1 cup of water. Bring to a boil.\r\nAdd the pork chops and lower the heat then simmer for 30 minutes or unitl tender.\r\nAdd in the onions and cook for another minute. Add more water and sugar is the sauce is too salty.\r\n', '', 0, 0, ''),
(18, 'Dinakdakan', '', '', 'In a pot, put the face mask and ear and pour water just enough to cover the pork, more or less 7 cups. Season with salt and pepper and bring to a boil. Simmer until fork tender, about 30 to 40 minutes.\r\nSlice the pork mask and ears and grill it in a stove top grill or a non-stick pan until the fat is rendered and becomes brown crispy. Slice into strips and put into a bowl. Set aside.\r\nIn a separate bowl, mix the onion, bird\'s eye chili peppers, green pepper, onion, ginger, mayonnaise, calamansi juice, vinegar, sugar, salt and pepper. Mix thoroughly and set aside.\r\nHeat and empty non-stick pan and saute the pork brain. Season with salt and pepper and stir until cooked and becomes a paste-like consistency. Remove from the pan and put it on the bowl on top of the sliced pork mask.\r\nPour the mixture of vinegar and spices on the sliced pork mask and toss until the mixture is evenly distributed with the pork.\r\nSeason again with salt and pepper to adjust the taste. Garnish with spring onions.\r\n', '', 0, 0, ''),
(19, 'Shrimp Laing', '', '', 'Mix hipon with onion, grated coconuts and salt.\r\nWrap about 1 tablespoon of shrimp mixture in gabi leaves.\r\nArrange in a pot. Pour thin coconut milk overwrapped mixture.\r\nCover. Simmer over low fire.\r\nShake pot to avoid burning of wrapped mixture.\r\nAdd thick coconut milk and siling labuyo when slightly cooked.\r\nContinue cooking until sauce thickens. Serve while hot.\r\n', '', 0, 0, ''),
(20, 'Pork Sisig', '', '', 'Wash pig\'s head and chicken liver. Boil in salted water until tender. Drain.\r\nBroil pig\'s head and chicken liver then cut into small pieces. Put in a preheated pan.\r\nDissolve Ginisa Flavor mix in vinegar. Add to chopped meat.\r\nPut in siling labuyo and dash of MSG. Mix well.\r\nAdd chopped onion and calamansi juice before serving.\r\n', '', 0, 0, ''),
(21, 'Adobong Kangkong', '', '', 'In a heated pan or wok, saute the Garlic and Onions.\r\nAdd water, Soy Sauce, and Vinegar.\r\nCover and Simmer for 10 minutes.\r\nAdd Kangkong and cook for 5 more minutes or until the Stems are totally cooked and tender.\r\nAdd more water if needed.\r\nServe with Ice cold Cook and Hot Rice.\r\n', '', 0, 0, ''),
(22, 'Bicol Express', '', '', 'Remove stems from the green chilies and cut lengthwise to remove seeds. Slice into 1/2 inch pieces.\r\nIn a casserole combine the pork, garlic, onion and coconut milk.\r\nBring to a boil, lower the heat and simmer until pork is tender.\r\nAdd the sliced chilies and continue cooking until chilies are soft and sauce is thickened.\r\nAdd shrimp paste to taste.\r\n', '', 0, 0, ''),
(23, 'Pork Menudo', '', '', 'Cook pork in water until tender. Dice. Saute garlic, onion, and tomatoes in lard.\r\nAdd pork and liver and continue sauteing for 5 minutes. Add water, salt, and pimentos.\r\nThen add potatoes, raisins, red and green pepper, and cooked garbanzos.\r\nCook until potatoes are done.\r\n', '', 0, 0, ''),
(24, 'Chicken Chop suey', '', '', 'Fry chicken and pork slices in hot shortening.\r\nAdd onions, ham, mushrooms and celery. Pan-fry a few minutes.\r\nThen add soy sauce, chestnuts, bamboo shoots, cauliflower, and carrots.\r\nAdd 1 cup stock and cook a few minutes more or until cauliflower is done.\r\nAdd the cornstarch paste and simmer for about 5 minutes.\r\nA few minutes before serving, add shredded cabbage and cut green onions.\r\nAdd more soy sauce and seasonings as desired.\r\n', '', 0, 0, ''),
(25, 'Tortang Talong', '', '', 'Roast the eggplants until the skin turns dark brown. Peel but retain the crown and steam. Set aside.\r\nSaute garlic until brown. Add onion. Stir cook for 2 minutes, then add ground pork, season with a little salt and MSG.\r\nSaute for 2 minutes, then add 1/4 cup water.\r\nCover. Simmer until it dries then set aside.\r\nCool the mixture for a few minutes then mix in the flour to bind the mixture.\r\nSlit eggplant lengthwise till it lays flat.\r\nSpread sauteed mixture on top of the eggplant and pour the beaten egg on top again.\r\nFry until golden brown.\r\n', '', 0, 0, ''),
(26, 'Pinoy Scrambled Eggs', '', '', 'Beat the eggs in a large bowl. Add the salt, ground black pepper, and garlic powder. Continue to beat until all the ingredients are well distributed.\r\nHeat a pan. Melt-in the butter.\r\nAdd the minced onion and tomato. Continue to cook in medium heat until the liquid that came out from the tomato evaporates (about 3 to 5 minutes).\r\nGradually pour-in the beaten egg mixture while continuously stirring. Continue to stir until the eggs become firm.\r\nTransfer to a serving plate. Top with chopped green onions.\r\n', '', 0, 0, ''),
(27, 'Fried Tilapia', '', '', 'Rub salt all over the fish including the insides.\r\nHeat oil in a wide frying pan\r\nWhen the oil is hot, put-in the tilapia. Cover the frying pan, but make sure to open it a little so that steam can come out. Fry each side in medium heat for about 6 to 10 minutes. Note: I usually wait until I donâ€™t hear any sound. This means that the liquid is gone and the fish is crisp.\r\nRemove from the pan and arrange in a serving plate.\r\n', '', 0, 0, ''),
(84, 'Tinola', '1-5', '', 'Heat oil in a large pot over medium heat. Add onion and garlic; cook and stir until fragrant, about 2 minutes. Add ginger and fish sauce; cook and stir for 1 to 2 minutes. Stir in chicken and cook for 5 minutes.\nPour in chicken broth and cook for 5 minutes. Add squash and simmer until chicken is no longer pink in the center, about 10 minutes. Season with salt and pepper.\nAdd bok choy and spinach; cook until spinach is just wilted, 1 to 2 minutes. Serve hot.', '', 0, 0, '');
